--
-- TOC entry 229 (class 1259 OID 16560)
-- Name: waiter_orders; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.waiter_orders AS
 SELECT o.employee_id,
    o.status_id,
    os.name AS status_name,
    sum(o.price) AS price,
    (o.creation_date + (o.serving_time)::interval) AS approximate_serving
   FROM ((public.orders o
     JOIN public.order_status os ON ((o.status_id = os.id)))
     JOIN public.ordered_dishes od ON ((o.id = od.order_id)))
  WHERE (o.status_id = ANY (ARRAY[1, 2, 3]))
  GROUP BY o.id, o.employee_id, o.status_id, os.name, o.creation_date, o.serving_time
  ORDER BY o.status_id DESC;


ALTER VIEW public.waiter_orders OWNER TO postgres;

