INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (13, 7, 'Квас', 500, 75, NULL, '00:00:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (10, 5, 'Оливье', 230, 300, 'Варьте картофель, морковь и горошек. Нарежьте варёные яйца, колбасу, салат и огурцы. Смешайте все вместе с майонезом и солью. Подавайте холодным.', '00:10:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (2, 1, 'Окрошка', 400, 335, 'Нарежьте огурцы, варёные яйца, колбасу и зелень. Добавьте квас и сметану, приправляйте солью и перцем. Подавайте со льдом.', '00:25:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (14, 7, 'Дюшес', 500, 50, NULL, '00:00:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (4, 2, 'Пепперони', 780, 750, 'Разместите томатный соус на тесте, добавьте моцареллу и пепперони. Выпекайте в духовке при температуре 200 градусов Цельсия в течение 10-15 минут.', '00:20:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (3, 2, 'Маргарита', 750, 680, 'Разместите томатный соус на тесте, добавьте моцареллу и базилик. Выпекайте в духовке при температуре 200 градусов Цельсия в течение 10-15 минут.', '00:20:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (1, 1, 'Борщ', 400, 250, 'Варите мясо с луком и морковью, добавьте картофель и свежую свеклу, тушите на малом огне. Добавьте томатную пасту, капусту и чеснок. Подавайте с сметаной и зеленью.', '00:30:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (6, 3, 'Шашлык из курицы', 300, 450, 'Нарежьте курицу на кусочки, маринуйте в соевом соусе и чесноке. Нанизьте на шампур и жарите на гриле или мангале до готовности.', '00:30:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (5, 3, 'Шашлык из свинины', 300, 650, 'Нарежьте свинину на кусочки, маринуйте в соевом соусе и чесноке. Нанизьте на шампур и жарите на гриле или мангале до готовности.', '00:40:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (9, 5, 'Цезарь', 230, 369, 'Салат ромэн, куриная грудка, белый хлеб, пармезан, яйцо, чеснок, анчоусы, лимонный сок, оливковое масло, дижонская горчица, соль, перец.', '00:15:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (8, 4, 'Карбонара', 250, 365, 'Обжарите бекон и добавьте спагетти. В отдельной посуде смешайте яйца, сыр и перец. Добавьте эту смесь в спагетти и бекон, тушите до готовности. Подавайте с дополнительным сыром.', '00:20:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (7, 4, 'Болоньезе', 250, 375, 'Обжарьте лук и чеснок, добавьте мясной фарш и тушите до готовности. Добавьте томатную пасту и томаты, тушите ещё 10 минут. Подавайте со спагетти и пармезаном.', '00:20:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (11, 6, 'Куринные наггетсы', 165, 239, 'Нарежьте курицу на мелкие кусочки, обваливайте в сухарях и жарите до готовности. Подавайте с кетчупом или майонезом.', '00:15:00', '\');
INSERT INTO public.dishes (id, category_id, name, weight, price, recipe, cooking_time, image) VALUES (12, 6, 'Брускетта с копчённой курицей', 130, 195, 'Нарежьте копчёную курицу на тонкие ломтики, положите на подсушенный хлеб и тушите в духовке до готовности. Подавайте с сыром и оливковым маслом.', '00:05:00', '\');


